import Header from "./Header";
import React from "react";
import Layout from "./MyLayout";

const Page = () => <p>This is the about page</p>;


export default function About() {
    return (
        <div>
            <Header/>
            <Layout>
                <p>This is the about page</p>
            </Layout>
        </div>
    );
}
